import React, { useState} from 'react';

import '../../assets/stylesheets/room.css';

const Room = props => {
    const [name, setName] = useState(props.name);

    return (
        <div>
            <h1>Room of {props.name}</h1>
            <div>
                <div>
                    campo do video
                </div>
                <div>
                    campo do chat / inserir nome para falar no chat
                </div>
                <div>
                    campo inserir video
                </div>
            </div>
        </div>
    )
}

export default Room;
